import React,{component, Component} from 'react';
import "./toolbat.css";

class Toolbar extends Component{

    render(){
        return(
            <div id="navigation">
            <ul>
            <li className="home"><a href="#"><span>Homepage</span></a></li>
            <li className="products"><a href="#"><span>Products &amp;amp;amp;amp; Services</span></a></li>
            <li className="contact"><a href="#"><span>Contact Us</span></a></li>
            </ul>
            </div>
        )
    }


}

export default Toolbar;
